{"operationName":"getHomepage","variables":{},"query":"query getHomepage {
  homepage {
    rows {
      __typename
      correlationName
      ... on JobCardRow {
        title
        subTitle
        solMetadata
        jobCount
        searchCriteria {
          keyword
          locations {
            id
            name
            __typename
          }
          categories {
            id
            name
            __typename
          }
          __typename
        }
        items {
          solMetadata
          id
          title
          company {
            name
            __typename
          }
          logo {
            url
            __typename
          }
          postedDate
          locations {
            name
            __typename
          }
          isNew
          isStandout
          isSaved
          savedJobId
          url
          __typename
        }
        __typename
      }
      ... on SearchCardRow {
        title
        subTitle
        items {
          newJobCount
          criteria {
            keyword
            locations {
              id
              name
              __typename
            }
            categories {
              id
              name
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
    }
    __typename
  }
}
"}
